// Web Worker for handling grid generation
let library = null;

function texFromImageData(imageData) {
    var mat = new Module.JTex(imageData.height, imageData.width);
    mat.data.set(imageData.data);
    return mat;
};

// Initialize the Module from the loaded script
self.onmessage = async function(event) {
    const { type, data } = event.data;

    if (type === 'init') {
        self.postMessage({ type: 'ready' });
    } else if (type === 'addTemplate') {

        if (library === null)
           library = new Module.TemplateLibrary();
        const { imageData, param, progress } = data;
        var src = texFromImageData(imageData);

        const t0 = Date.now();
        Module.add_template(src, library, param);
        const elapsedMs = Date.now() - t0;
        src.delete();
        //try {
            console.log(`Module.add_template took ${elapsedMs.toFixed(3)} ms`);
        //} catch (e) { }

         self.postMessage({
                    type: 'templateResult',
                    data: {
                        progress: progress,
                        addTemplateTimeMs: elapsedMs
                    }});

    } else if (type === 'generateGrid') {
        const { imageData, numTry, RegMinPixels, RegAreaFactor, templatesText2, batch } = data;
        
        try {            
            var src = texFromImageData(imageData);

            var func_grid = function (rand) {
                let dst = Module.generate_grid(rand, src, library, numTry, RegMinPixels, RegAreaFactor, templatesText2);
                
                // Convert the result to a format that can be transferred
                const imageDataArray = new Uint8ClampedArray(dst.data);
                
                self.postMessage({
                    type: 'gridResult',
                    data: {
                        imageData: imageDataArray,
                        width: dst.width,
                        height: dst.height
                    }
                }, [imageDataArray.buffer]);
                
                dst.delete();
            };

            for(let i=0; i<batch; i++) {
                const curTime = Date.now() & 0x0fffffff;
                func_grid(curTime + i);
            }

            src.delete();
            library.delete();
            library = null;

        } catch (error) {
            self.postMessage({
                type: 'error',
                error: error.message
            });
        }
    }
};

